window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling Author L. B. Gilbert. </p><p>Despite being the junior Elemental, Logan's never had to worry about failing a mission before. Not until an overgrown and annoyingly attractive shifter comes along. </p><p>Being an Elemental is in Logan's blood. Hers is the gift of Air, a vast power she's still struggling to control. Then a Were named Connell hunts her down. His wolf is missing, and he blames her. A den of werewolves is the last place Logan wants to be. The testosterone alone is enough to make her choke. But she has a mystery to solve. She will find out who is stealing wolves even if kills her. Unfortunately, that's exactly what the enemy has planned.... </p>"; 
